import React from "react";
import { Paper, Divider, Grid } from "@material-ui/core";
import { makeStyles, MuiThemeProvider } from "@material-ui/core/styles";
import Typography from "@material-ui/core/Typography";
import { storiesOf } from "@storybook/react";
import themes from "../../../Theme/themes";
import { styles } from "../../styles";
import FullCalendar1day from "../FullCalendar1day";

const useStyles = makeStyles(theme => ({
    ...styles,
    rootBg: {
        background: theme.palette.primary.main,
        boxShadow: theme.shadows[8],
        padding: "30px",
    },
    darkBg: {
        background: "rgba(0, 0, 0, 0.6)",
        boxShadow: theme.shadows[8],
        padding: "30px",
    },
}));

export const DefaultFullCalendar1day = ({
    brand,
    mode,
    isMobile,
    error,
    errorMsg,
    originLabel,
    destinyLabel,
}) => {
    const classes = useStyles(themes[brand]);

    return (
        <MuiThemeProvider theme={themes[brand]}>
            <Paper className={classes[mode]} id="calendar">
                <Typography variant="h3">FullCalendar1day</Typography>
                <br />
                <Divider />
                <br />

                <Grid xs={3}>
                    <FullCalendar1day
                        onDateChange={date => {}}
                        isMobile={isMobile}
                        error={error}
                        errorMsg={errorMsg}
                        originLabel={originLabel}
                        destinyLabel={destinyLabel}
                    />
                </Grid>
            </Paper>
        </MuiThemeProvider>
    );
};

const argsControls = {
    args: {
        brand: "CVC",
        mode: "rootBg",
        isMobile: false,
        error: false,
        errorMsg: "Selecione as datas corretamente",
        originLabel: "Origem",
        destinyLabel: "Destino",
    },
    argTypes: {
        brand: {
            type: "select",
            options: ["BlackAndWhite", "BlackFriday", "CVC", "CVCCorp", "CVCYellow", "Sub"]
        },
        mode: {
            type: "select",
            options: ["rootBg", "darkBg"]
        },
        isMobile: { type: "boolean" },
        error: { type: "boolean" },
        errorMsg: { type: "string" },
        originLabel: { type: "string" },
        destinyLabel: { type: "string" },
    }
}

storiesOf("Components/Calendars/FullCalendar1day", module).addParameters({ storySource: { source: __STORY__, locationsMap: __LOCATIONS_MAP__ } })
    .add("Default ", (args) => <DefaultFullCalendar1day {...args}/>, argsControls);
